С 2019 года вместе с командой я плодотворно занимаюсь интернет-маркетингом и увеличиваю продажи различных товаров и услуг в разных нишах бизнеса.

Преимущества:

- постоянно нахожусь на связи и отвечаю на звонки и письма;
- работаю по доступным ценам, всегда иду навстречу клиентам;
- работаю как ИП, оформляю официальный договор, прописываю гарантии и ответственность;
- обладаю обширным опытом в создании сайтов и настройке Яндекс Директ и Google AdWords
- дорожу репутацией и работаю с клиентами "на результат"
